import PropTypes from 'prop-types';
import React from "react";
import { Link } from "react-router-dom";
import {Nav, NavDropdown, Navbar} from "react-bootstrap";

function toggle() {
  this.setState(prevState => ({
    dropdownOpen: !prevState.dropdownOpen
  }));
}

function onMouseEnter() {
  this.setState({dropdownOpen: true});
}

function onMouseLeave() {
  this.setState({dropdownOpen: false});
}

function HeaderNavbar() {

  return (
    <Navbar id="navbar-bg" collapseOnSelect expand="lg" variant="dark">
      <Navbar.Toggle aria-controls="responsive-navbar-nav" />
      <Navbar.Collapse id="responsive-navbar-nav">
        <Nav className="mr-auto">
          <Nav.Link as={Link} to="/home">Startseite</Nav.Link>
          <NavDropdown title="Leistungen" id="collasible-nav-dropdown">
            <NavDropdown.Item as={Link} to="/leistung1">Leistung1</NavDropdown.Item>
            <NavDropdown.Item as={Link} to="/leistung2">Leistung2</NavDropdown.Item>
            <NavDropdown.Item as={Link} to="/leistung3">Leistung3</NavDropdown.Item>
          </NavDropdown>
          <Nav.Link as={Link} to="/aboutMe">Ãœber mich</Nav.Link>
          <Nav.Link as={Link} to="/contact">Kontakt</Nav.Link>
        </Nav>
      </Navbar.Collapse>
    </Navbar>
  );
}

export default HeaderNavbar;
